import { AltFile, File } from "../types/file";


export const prepareFileForUpload = (file: File | AltFile | undefined) => {

    let processedFile: {
        name?: string,
        type?: string,
        buffer?: any
    } | undefined = undefined


    if (file) {
        processedFile = {
            name: file?.name,
            type: file?.type,
            buffer: null
        }

        if ('blob' in file) {
            const data = new FormData();

            data.append('file', file.blob);

            processedFile.buffer = data

        } else if ('stream' in file) {
            processedFile.buffer = file
        }
    }

    return processedFile
}

